import React from "react";
import { NavLink } from 'react-router-dom';
import "../css/Navbar.css";


const NavigationBar = () => (
    <Navbar>
        <NavLink exact
            activeClassName="navbar__link--active"
            className="navbar__link" to="/">Home</NavLink>
        <NavLink activeClassName="navbar__link--active"
            className="navbar__link" to="/inspiration">Inspiration</NavLink>
        <NavLink activeClassName="navbar__link--active"
            className="navbar__link" to="/certificates">Coursework</NavLink>
        <NavLink activeClassName="navbar__link--active"
            className="navbar__link" to="/contact">Contact</NavLink>
    </Navbar>
);

export default NavigationBar;


